	render(){
		return(
			<div>
         		<Router>
				<Switch>
										<Route path="/admin" component={Admin} >
													<Route path="/admin" component={Admin} />
										</Route>
										<Route path="/" component={Index} >
													<Route path="/" component={Index} />
										</Route>

				</Switch>
</Router>
     		</div>

		);
	}
}
export default Main;
